INSERT INTO `service_required_document` VALUES (1,'\n',NULL),(2,'\n             Доверенность от юридического лица – учредителя компании установленного образца на представителя Ipravo',NULL),(3,'\n            6. Копия паспорта директора компании гражданина ЕВРАЗЭС с нотариально засвидетельствованным переводом на казахский и русский языки',NULL),(4,'\n            Апостилированная/Легализованаая копия паспорта директора юридического лица с нотариально заверенным переводом на казахский и русский язык',NULL),(5,'\n            Генеральная доверенность на руководителя (легализованная)',NULL),(6,'\n            Генеральная доверенность на руководителя (легализованная) с нотариально заверенным переводом на русский или казахский языки',NULL),(7,'\n            Государственная пошлина  около 225 МРП (510,525 тенге), для первой категории работников',NULL),(8,'\n            Государственная пошлина для рабочего разрещения около 225 МРП (510,525 тенге), для первой категории работников',NULL),(9,'\n            Действительный заграничный паспорт иностранного государства предоставляющий право на пересечение Государственной границы Республики Казахстан;',NULL),(10,'\n            Доверенность на представителя Ipravo',NULL),(11,'\n            Договор аренды офиса',NULL),(12,'\n            Документ, послуживший основанием для внесения изменения в регистрационные данные недвижимого имущества.',NULL),(13,'\n            Другие документы, относящиеся к земельному участку.',NULL),(14,'\n            Другие документы, относящиеся к объекту недвижимости.',NULL),(15,'\n            Заключение антимонопольного органа, представляемое им в течение 10 рабочих дней с момента получения письменного уведомления должника об обращении в суд, о признании его банкротом, в случае, если должник является субъектом рынка, занимающим доминирующее (монопольное) положение на соответствующем товарном рынке',NULL),(16,'\n            Заполнение формы на внесение изменений и дополнений в учредительные документы',NULL),(17