ight (economic management or operational management) and (or) leases\nObligatory availability of the minimum material equipment on the property right (economic management or operational management) and (or) leases:\ninstrumentations, mechanisms, devices which are used depending on the engineering requirements necessary for accomplishment of the stated works of subspecies; the licensed type of activity (a level, a theodolite, a support, laths, a milestone, GPS, the tacheometer).\nThe personal computer with the established software necessary for accomplishment of calculations, drawing up and registrations of graphic and other materials at implementation of engineering and geodetic works (AutoCAD)'),(152,15,2,326,'Step 1. Preliminary verification of documents (the personal meeting with the Ipravo team is obligatory)'),(161,15,2,327,'Step 2. Payment of the state fee'),(164,15,2,328,'Step 3. Submission of documents on obtaining the license (personal presence is not required)'),(173,15,2,329,'Step 3.1. Receipt of the original set of documents (personal presence is not required)*'),(176,15,2,330,'Step 4. Receipt of the original set of documents (personal presence is not required)*'),(180,19,2,118,'Prospecting activity: engineering and geodetic works'),(181,19,2,119,'Prospecting activity: engineering-geological and engineering and hydrogeological works'),(182,35,2,125,'* Power of attorney / Electronically digital signature (when applicable)'),(183,35,2,144,'The lease agreement or documents of title on the property right confirming availability of production base'),(184,35,2,156,'Request in electronic form, the uslugopoluchatel certified by the EDS (it is formed electronically) (A form of data)'),(185,35,2,159,'Instructions on a quality control system, instruction for the system of labor protection and safe engineering'),(186,35,2,172,'The copy of the license or the relevant official allowing document of the foreign state having the corresponding assurance according to the Law of the Republic of Kazakhstan \"About a Notariate\" (A form of data)'),(187,35,2,185,'It is not applicable'),(188,35,2,210,'en Правоустанавливающие документы, подтверждающие регистрацию недвижимого имущества.'),(189,35,2,245,'Certificate of registration of legal entity'),(190,35,2,246,'Invoices, inventory cards confirming availability of the minimum material equipment'),(191,35,2,249,'The employment contract, the diploma about educations, the service record on specialists:\nEngineering-geological and engineering and hydrogeological works\n           - Geophysical surveys, reconnaissance and shooting (the Specialist – the Geophysicist)\n           - Field surveys of soil, hydrogeological researches (the Specialist – the Hydrogeologist)'),(192,35,2,250,'The employment contract, the diploma about educations, the service record on specialists:\nEngineering and geodetic works\n           - Construction and laying of the geodetic centers (the Specialist – the Surveyor)\n           - Creation of plans - high-rise film-making networks (the Specialist – the Surveyor)\n           - Topographical works for design and construction (the Specialist – the Topographer)\n           - The geodetic works connected with transfer in nature with a binding of engineering-geological developments, geophysical and other points of researches (the Specialist – the Surveyor)'),(193,35,2,254,'The charter, the protocol, the order (for the legal entity)'),(194,35,2,258,'Form of the data containing information on presence of the certified engineering employees according to appendix to qualification requirements (A form of data)'),(195,35,2,259,'Form of the data containing information about about administrative and household rooms according to appendix to qualification requirements (A form of data)'),(196,35,2,260,'Form of the data containing information on the software according to appendix to qualification requirements (A form of data)'),(197,35,2,261,'Form of the data containing information on