вующий аттестат по профилю работ входящих в состав запрашиваемого подвида лицензируемого вида деятельности и работающего на постоянной основе у заявителя по одной из следующих специализаций:\nСпециальные работы в грунтах, в том числе:\n      1) устройство оснований; (Специалист – Инженер ПГС, Минимальная материально-техническая оснащенность на праве собственности - экскаватор, бульдозер, самосвал, кран, нивелир, теодолит, трамбовка, сваебойное оборудование)\n      2) обустройство скважин (за исключением нефтяных и газовых скважин); (Специалист – Инженер ПГС, Минимальная материально-техническая оснащенность на праве собственности - самосвал, буровая установка)\n      3) буровые работы в грунте;  (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности - буровая  установка)\n      4) подводно-технические работы и работы на морском шельфе; (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности – экскаватор,  драглайн, сварочное оборудование для подводных работ, водолазное оборудование, баржа)'),(228,14,2,91,'For refining at the cost of services, we ask to contact sales office\nObligatory production base on the property right (economic management or operational management) and (or) the lease equipped:\n1) the administrative process buildings or rooms necessary for accomplishment of the stated work types, subspecies of the licensed type of activity. At the same time office, process and other buildings or premises of production base can be combined if it does not contradict requirements of a system of labor protection and safe engineering at work and also does not violate a working condition of administrative, technical and production workers.\n2) the jobs organized in accordance with the terms work\nAvailability in the state not less than one the certified engineering employee having the corresponding certificate on a profile of the works which are a part of required subspecies of the licensed type of activity and working at a permanent basis at the applicant on one of the following specializations:\nSpecial works in soil, including:\n      1) device of the bases; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - the excavator, the bulldozer, the dump truck, the crane, a level, a theodolite, tamper, the svayeboyny equipment)\n      2) construction of surface facilities for wells (except for oil and gas wells); (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - the dump truck, the drilling rig)\n      3) drilling operations in soil; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - the drilling rig)\n      4) underwater and technical works and works on the sea shelf; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right – the excavator, the dragline, the welding equipment for underwater works, the diving equipment, the barge)'),(229,15,2,331,'Step 1. Preliminary verification of documents (the personal meeting with the Ipravo team is obligatory)'),(230,35,2,512,'The employment contract, the diploma about educations, the service record the confirming corresponding education and qualification of specialists.'),(231,15,2,332,'Step 2. Payment of the state fee'),(232,15,2,333,'Step 3. Submission of documents on obtaining the license (personal presence is not required)'),(233,15,2,334,'Step 3.1. Receipt of the original set of documents (personal presence is not required)*'),(234,15,2,335,'Step 4. Receipt of the original set of documents (personal presence is not required)*'),(235,32,2,3,'The construction of the bearing and (or) enclosing structures of buildings and constructions (including bridges, transport platforms, tunnels and overpasses, other artificial buildings) including capital repairs and reconstruction of objects'),(236,11,1,92,'KZTLC43'),(237,11,2,92,'KZTLC43'),(238,12,1,92,'Строительно-монтажные работы III категория'),(239,12,2,92,'Installation and construction works the III category'),(240,13,1,92,'Строительно-монтажные работы III категория'),(241,13,2,92,'Installation and construction works the III category'),(242,14,1,92,'Для уточнения по стоимости услуг, просим связаться с отделом продаж\nОбязательное производственной базы на праве собственности (хозяйственного ведения или оперативного управления) и (или) аренды, оснащенной:\n1) административно-производственными зданиями или помещениями, необходимыми для выполнения заявленных видов работ, подвида лицензируемого вида деятельности. При этом административные, производственные и иные здания или помещения производственной базы могут быть совмещены, если это не противоречит требованиям системы охраны труда и техники безопасности при проведении работ, а также не нарушает условия труда административных, технических и производственных работников.\n2) рабочими местами, организованными в соответствии с условиями труда\nНаличие в штате не менее одного аттестованного инженерно-технического работника, имеющего соответствующий аттестат по профилю работ входящих в состав запрашиваемого подвида лицензируемого вида деятельности и работающего на постоянной основе у заявителя по одной из следующих специализаций:\nВозведение несущих и (или) ограждающих конструкций зданий и сооружений (в том числе мостов, транспортных эстакад, тоннелей и путепроводов, иных искусственных строений), включающее капитальный ремонт и реконструкцию объектов, в том числе:\n      1) монтаж металлических конструкций; (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности - САГ, кран, башенный кран (для I категории)\n      2) монтаж строительных конструкций башенного и мачтового типа, дымовых труб; (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности - опалубка, леса строительные, кран, бетононасос (бадья, туфелька), бетоносмеситель (бетономешалка), башенный кран (для I категории)\n      3) монтаж несущих конструкций мостов и мостовых переходов; (Специалист – Инженер мостов, Минимальная материально -техническая оснащенность на праве собственности - опалубка, леса строительные, кран, бетононасос (бадья, туфелька), бетоносмеситель (бетономешалка), башенный кран (для I категории)\n      4) гидротехнические и селезащитные сооружения, плотины, дамбы; (Минимальная материально -техническая оснащенность на праве собственности - скрепер, кран, сваебойная установка, опалубка, леса строительные, кран, бетононасос (бадья, туфелька), бетоносмеситель (бетономешалка), башенный кран (для I категории) \n5) дымовые трубы, силосные сооружения, градирни, надшахтные копры; (Минимальная материально -техническая оснащенность на праве собственности - опалубка, леса строительные, кран, бетононасос (бадья, туфелька), бетоносмеситель (бетономешалка), башенный кран (для I категории))\n      6) горнопроходческие и тоннельные работы, устройство противофильтрационных завес; (Специалист - горный инженер строитель, Минимальная материально -техническая оснащенность на праве собственности - горнопроходческий комбайн, горнопроходческий комплекс)\n      7) монтаж строительных конструкций подъемных сооружений (лифтов, эскалаторов, шахтных копров и подъемников, канатных дорог и других конструкций подъемных сооружений); Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности - тельфер, набор ключей, кран, самосвал)\n      8) устройство монолитных, а также монтаж сборных бетонных и железобетонных конструкций, кладка штучных элементов стен и перегородок и заполнение проемов;  (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности -автобетоносмеситель, бетононасос (бадья для бетона),  глубинные вибраторы, опалубка, леса строительные, газорезательная аппаратура, кран)\n      9) кровельные работы; (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности - автовышка, инструмент кровельщика)'),(243,14,2,92,'For refining at the cost of services, we ask to contact sales office\nObligatory production base on the property right (economic management or operational management) and (or) the lease equipped:\n1) the administrative process buildings or rooms necessary for accomplishment of the stated work types, subspecies of the licensed type of activity. At the same time office, process and other buildings or premises of production base can be combined if it does not contradict requirements of a system of labor protection and safe engineering at work and also does not violate a working condition of administrative, technical and production workers.\n2) the jobs organized in accordance with the terms work\nAvailability in the state not less than one the certified engineering employee having the corresponding certificate on a profile of the works which are a part of required subspecies of the licensed type of activity and working at a permanent basis at the applicant on one of the following specializations:\nThe construction of the bearing and (or) enclosing structures of buildings and constructions (including bridges, transport platforms, tunnels and overpasses, other artificial buildings) including capital repairs and reconstruction of objects including:\n      1) installation of metal designs; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - SAG, the crane, the tower crane (for the I category)\n      2) installation of building constructions of tower and mast type, chimneys; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - a timbering, the woods construction, the crane, the concrete pump (a tub, a shoe), a betonosmesitel (concrete mixer), the tower crane (for the I category)\n      3) installation of bearing structures of bridges and bridge crossings; (The specialist – the Engineer of bridges, the Minimum material equipment on the property right - a timbering, the woods construction, the crane, the concrete pump (a tub, a shoe), a betonosmesitel (concrete mixer), the tower crane (for the I category)\n      4) hydraulic engineering and selezashchitny constructions, dams, dams; (The minimum material equipment on the property right - the scraper, the crane, svayeboyny installation, a timbering, the woods construction, the crane, the concrete pump (a tub, a shoe), a betonosmesitel (concrete mixer), the tower crane (for the I category)\n5) chimneys, silage constructions, coolers, nadshakhtny copras; (The minimum material equipment on the property right - a timbering, the woods construction, the crane, the concrete pump (a tub, a shoe), a betonosmesitel (concrete mixer), the tower crane (for the I category))\n      6) tunnelling and tunnel works, device of antifiltrational veils; (The specialist - the mining engineer the builder, the Minimum material equipment on the property right - the tunnelling combine, a tunnelling complex)\n      7) installation of building constructions of lifting constructions (elevators, escalators, mine kopr and elevators, cableways and other designs of lifting constructions); The Specialist is an Engineer of PGS, the Minimum material equipment on the property right - the telpher, a set of keys, the crane, the dump truck)\n      8) device monolithic and also installation of combined concrete and reinforced concrete structures, laying of piece elements of walls and partitions and filling of apertures; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - an avtobetonosmesitel, the concrete pump (a tub for concrete), deep vibrators, a timbering, the woods construction, the gas-cutting equipment, the crane)\n      9) roofing works; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - an autotower, the roofer\'s tool)'),(244,15,2,336,'Step 1. Preliminary verification of documents (the personal meeting with the Ipravo team is obligatory)'),(245,15,2,337,'Step 2. Payment of the state fee'),(246,15,2,338,'Step 3. Submission of documents on obtaining the license (personal presence is not required)'),(247,15,2,339,'Step 3.1. Receipt of the original set of documents (personal presence is not required)*'),(248,15,2,340,'Step 4. Receipt of the original set of documents (personal presence is not required)*'),(249,32,2,4,'The special construction and installation works on laying of linear constructions including capital repairs and reconstruction'),(250,11,1,93,'KZTLC44'),(251,11,2,93,'KZTLC44'),(252,12,1,93,'Строительно-монтажные работы III категория'),(253,12,2,93,'Installation and construction works the III category'),(254,13,1,93,'Строительно-монтажные работы III категория'),(255,13,2,93,'Installation and construction works the III category'),(256,14,1,93,'Для уточнения по стоимости услуг, просим связаться с отделом продаж\nОбязательное производственной базы на праве собственности (хозяйственного ведения или оперативного управления) и (или) аренды, оснащенной:\n1) административно-производственными зданиями или помещениями, необходимыми для выполнения заявленных видов работ, подвида лицензируемого вида деятельности. При этом административные, производственные и иные здания или помещения производственной базы могут быть совмещены, если это не противоречит требованиям системы охраны труда и техники безопасности при проведении работ, а также не нарушает условия труда административных, технических и производственных работников.\n2) рабочими местами, организованными в соответствии с условиями труда\nНаличие в штате не менее одного аттестованного инженерно-технического работника, имеющего соответствующий аттестат по профилю работ входящих в состав запрашиваемого подвида лицензируемого вида деятельности и работающего на постоянной основе у заявителя по одной из следующих специализаций:\n  Специальные строительные и монтажные работы по прокладке линейных сооружений, включающие капитальный ремонт и реконструкцию, в том числе:\n      1) стальных резервуаров (емкостей), включая работающих под давлением либо предназначенных для хранения взрывопожароопасных или иных опасных (вредных) жидких или газообразных веществ; (Специалист – Инженер ПГС, Минимальная материально -техническая оснащенность на праве собственности - САГ, Кран, башенный кран (для I категории)\n      2) промысловых и магистральных сетей нефтепроводов, газопроводов, а также магистральных сетей нефтепродуктопроводов;  (Специалист – Инженер нефтяник, Минимальная материально -техническая оснащенность на праве собственности - трубоукладчик, экскаватор, бульдозер, дефектоскоп, сидельный тягач, манипулятор, кран, сварочное оборудование)\n      3) магистральных линий электропередач с напряжением до 35 кВ и до  110 кВ и выше; (Специалист – Инженер электрик, Минимальная материально -техническая оснащенность на праве собственности - автовышка, экскаватор, ямобур, кабелеукладчик, бульдозер, контрольно-измерительные приборы электрика)\n      4) общереспубликанских и международных линий связи и телекоммуникаций; (Специалист - связист, Минимальная материально -техническая оснащенность на праве собственности -автовышка, экскатор, ямобур, кабелеукладчик, бульдозер, контрольно-измерительные приборы связиста)'),(257,14,2,93,'For refining at the cost of services, we ask to contact sales office\nObligatory production base on the property right (economic management or operational management) and (or) the lease equipped:\n1) the administrative process buildings or rooms necessary for accomplishment of the stated work types, subspecies of the licensed type of activity. At the same time office, process and other buildings or premises of production base can be combined if it does not contradict requirements of a system of labor protection and safe engineering at work and also does not violate a working condition of administrative, technical and production workers.\n2) the jobs organized in accordance with the terms work\n\"Availability in the state not less than one the certified engineering employee having the corresponding certificate on a profile of the works which are a part of required subspecies of the licensed type of activity and working at a permanent basis at the applicant on one of the following specializations:\n  The special construction and installation works on laying of linear constructions including capital repairs and reconstruction including:\n      1) steel tanks (capacities), including fire and explosion hazardous or other dangerous (harmful) liquid or gaseous substances working under pressure or intended for storage; (The specialist – the Engineer of PGS, the Minimum material equipment on the property right - SAG, the Crane, the tower crane (for the I category)\n      2) trade and high-level networks of oil pipelines, gas pipelines and also high-level networks of oil pipelines; (The specialist – the Engineer the oil industry worker, the Minimum material equipment on the property right - the pipe layer, the excavator, the bulldozer, the defectoscope, the truck tractor, the manipulator, the crane, the welding equipment)\n      3) the main power lines with tension to 35 kV and up to 110 kV and above; (The specialist – the Electrical engineer, the Minimum material equipment on the property right - an autotower, the excavator, ямобур, the cable layer, the bulldozer, instrumentations of the electrician)\n      4) all-republican and international communication lines and telecommunications; (The specialist - the operator, the Minimum material equipment on the property right - an autotower, an ekskator, ямобур, the cable layer, the bulldozer, instrumentations of the operator)\"'),(258,15,2,341,'Step 1. Preliminary verification of documents (the personal meeting with the Ipravo team is obligatory)'),(259,15,2,342,'Step 2. Payment of the state fee'),(260,15,2,343,'Step 3. Submission of documents on obtaining the license (personal presence is not required)'),(261,15,2,344,'Step 3.1. Receipt of the original set of documents (personal presence is not required)*'),(262,15,2,345,'Step 4. Receipt of the original set of documents (personal presence is not required)*'),(263,32,2,5,'The structure of engineering networks and systems including capital repairs and reconstruction'),(264,11,1,94,'KZTLC45'),(265,11,2,94,'KZTLC45'),(266,12,1,94,'Строительно-монтажные работы III категория'),(267,12,2,94,'Installation and construction works the III category'),(268,13,1,94,'Строительно-монтажные работы III категория'),(269,13,2,94,'Installation and construction works the III category'),(270,14,1,94,'Для уточнения по стоимости услуг, просим связаться с отделом продаж\nОбязательное производственной базы на праве собственности (хозяйственного ведения или оперативного управления) и (или) аренды, оснащенной:\n1) административно-производственными зданиями или помещениями, необходимыми для выполнения заявленных видов работ, подвида лицензируемого вида деятельности. При этом административные, производственные и иные здания или помещения производственной базы могут быть совмещены, если это не противоречит требованиям системы охраны труда и техники безопасности при проведении работ, а также не нарушает условия труда административных, технических и производственных работников.\n2) рабочими местами, организованными в соответствии с условиями труда\nНаличие в штате не менее одного аттестованного инженерно-технического работника, имеющего соответствующий аттестат по профилю работ входящих в состав запрашиваемого подвида лицензируемого вида деятельности и работающего на постоянной основе у заявителя по одной из следующих специализаций:\n   Устройство инженерных сетей и систем, включающее капитальный ремонт и реконструкцию, в том числе:\n      1) сетей электроснабжения железнодорожных путей сообщения, сетей электроснабжения и электроосвещения предприятий воздушного транспорта; (Специалист - Инженер электрик на  ЖД, Минимальная материально -техническая оснащенность на праве собственности - дрезина, бульдозер, автовышка, экскаватор, ямобур, кабелеукладчик, бульдозер, контрольно-измерительные приборы электрика)\n      2) сетей газоснабжения высокого и среднего давления, бытового и производственного газоснабжения низкого давления, внутренних систем газоснабжения; (Специалист - Инженер-проектировщик ТГВ,  Минимальная материально -техническая оснащенность на праве собственности - трубоукладчик, экскаватор, бульдозер,  сидельный тягач, манипулятор, кран, сварочное оборудование)\n      3) сетей холодного и горячего водоснабжения, теплоснабжения, централизованной канализации бытовых, производственных и ливневых стоков, устройства внутренних систем водопровода, отопления и канализации; (Специаист - Инженер ВК, Минимальная материально -техническая оснащенность на праве собственности - ТГВ, БАР, самосвал, САГ, экскаватор, аппарат для пайки пропиленовых труб, инструмент сантехника, инструмент плотника, трубоукладчик, экскаватор, бульдозер,  сидельный тягач, манипулятор, кран, сварочное оборудование)\n      4) сетей электроснабжения и устройства наружного электроосвещения, внутренних систем электроосвещения и электроотопления; (Специалист - Инженер электрик, Минимальная материально -техническая оснащенность на праве собственности - автовышка, экскаватор, ямобур, кабелеукладчик, бульдозер, контрольно-измерительные приборы электрика)'),(271,14,2,94,'For refining at the cost of services, we ask to contact sales office\nObligatory production base on the property right (economic management or operational management) and (or) the lease equipped:\n1) the administrative process buildings or rooms necessary for accomplishment of the stated work types, subspecies of the licensed type of activity. At the same time office, process and other buildings or premises of production base can be combined if it does not contradict requirements of a system of labor protection and safe engineering at work and also does not violate a working condition of administrative, technical and production workers.\n2) the jobs organized in accordance with the terms work\n\"Availability in the state not less than one the certified engineering employee having the corresponding certificate on a profile of the works which are a part of required subspecies of the licensed type of activity and working at a permanent basis at the applicant on one of the following specializations:\n   The structure of engineering networks and systems including capital repairs and reconstruction including:\n      1) networks of power supply of railway tracks of the message, networks of power supply and electric lighting of the enterprises of air transport; (The specialist - the Electrical engineer on railway, the Minimum material equipment on the property right - the draisine, the bulldozer, an autotower, the excavator, ямобур, the cable layer, the bulldozer, instrumentations of the electrician)\n      2) networks of gas supply of high and average pressure, household and production gas supply of low pressure, internal gas supply systems; (The specialist - the Design engineer of TGV, the Minimum material equipment on the property right - the pipe layer, the excavator, the bulldozer, the truck tractor, the manipulator, the crane, the welding equipment)\n      3) networks of cold and hot water supply, heat supply, the centralized sewerage of domestic, production and storm sewages, the device of internal systems of a water supply system, heating and the sewerage; (The Spetsiaist - the Engineer of VK, the Minimum material equipment on the property right - TGV, BAR, the dump truck, SAG, the excavator, the device for soldering the propilenovykh of pipes, the tool of the plumber, the carpenter\'s tool, the pipe layer, the excavator, the bulldozer, the truck tractor, the manipulator, the crane, the welding equipment)\n      4) networks of power supply and device of an external electric lighting, internal systems of an electric lighting and electric heating; (The specialist - the Electrical engineer, the Minimum material equipment on the property right - an autotower, the excavator, ямобур, the cable layer, the bulldozer, instrumentations of the electrician)\"'),(272,15,2,346,'Step 1. Preliminary verification of documents (the personal meeting with the Ipravo team is obligatory)'),(273,15,2,347,'Step 2. Payment of the state fee'),(274,15,2,348,'Step 3. Submission of documents on obtaining the license (personal presence is not required)'),(275,15,2,349,'Step 3.1. Receipt of the original set of documents (personal presence is not required)*'),(276,15,2,350,'Step 4. Receipt of the original set of documents (personal presence is not required)*'),(277,32,2,6,'Construction automobile and the railroads, including capital repairs and reconstruction'),(278,11,1,95,'KZTLC46'),(279,11,2,95,'KZTLC46'),(280,12,1,95,'Строительно-монтажные работы III категория'),(281,12,2,95,'Installation and construction works the III category'),(282,13,1,95,'Строительно-монтажные работы III категория'),(283,13,2,95,'Installation and construction works the III category'),(284,14,1,95,'Для уточнения по стоимости услуг, просим связаться с отделом продаж\nОбязательное производственной базы на праве собственности (хозяйственного ведения или оперативного управления) и (или) аренды, оснащенной:\n1) административно-производственными зданиями или помещениями, необходимыми для выполнения заявленных видов работ, подвида лицензируемого вида деятельности. При этом административные, производственные и иные здания или помещения производственной базы могут быть совмещены, если это не противоречит требованиям системы охраны труда и техники безопасности при проведении работ, а также не нарушает условия труда административных, технических и производственных работников.\n2) рабочими местами, организованными в соответствии с условиями труда\nНаличие в штате не менее одного аттестованного инженерно-технического работника, имеющего соответствующий аттестат по профилю работ входящих в состав запрашиваемого подвида лицензируемого вида деятельности и работающего на постоянной основе у заявителя по одной из следующих специализаций:\n    Строительство автомобильных и железных дорог, включающее капитальный ремонт и реконструкцию, в том числе:      \n      1) основания и верхние строения железнодорожных путей; (Специалист - Инженер строитель путей сообщения, Минимальная материально -техническая оснащенность на праве собственности - кран, станок, шпалоподбойник, самосвал, экскаватор, бульдозер, грейдер, нивелир, теодолит,  рельсоукладчик (путеукладчик),  сварочный аппарат) \n      2) основания и покрытия, защитные сооружения и обустройство автомобильных дорог I и II технической категории, а также внутригородских магистральных дорог скоростного и регулируемого движения, проезжей части магистральных улиц общегородского значения непрерывного и регулируемого движения; (Специалист -Инженер автодорог, Минимальная материально - техническая оснащенность на праве собственности - автогрейдер, автогудронатор, асфальтоукладчик    самосвал, фреза, поливомоечная машина,  каток , бетоноукладчик)\n      3) основания и покрытия, защитные сооружения и обустройство автомобильных дорог III, IV и V технической категории, а также проезжей части улиц населенных пунктов, не являющихся магистральными; (Специалист -Инженер автодорог, Минимальная материально - техническая оснащенность на праве собственности - автогрейдер, автогудронатор, асфальтоукладчик, самосвал, фреза, поливомоечная машина,  каток)\n      4) основания и покрытия взлетно-посадочных полос аэродромов и вертолетных площадок;  \n(Специалист -Инженер автодорог и аэродромов, Минимальная материально - техническая оснащенность на праве собственности - автогрейдер, автогудронатор, асфальтоукладчик    самосвал, фреза, поливомоечная машина,  каток, бетоноукладчик)'),(285,14,2,95,'For refining at the cost of services, we ask to contact sales office\nObligatory production base on the property right (economic management or operational management) and (or) the lease equipped:\n1) the administrative process buildings or rooms necessary for accomplishment of the stated work types, subspecies of the licensed type of activity. At the same time office, process and other buildings or premises of production base can be combined if it does not contradict requirements of a system of labor protection and safe engineering at work and also does not violate a working condition of administrative, technical and production workers.\n2) the jobs organized in accordance with the terms work\n\"Availability in the state not less than one the certified engineering employee having the corresponding certificate on a profile of the works which are a part of required subspecies of the licensed type of activity and working at a permanent basis at the applicant on one of the following specializations:\n    Construction automobile and the railroads, including capital repairs and reconstruction, including:      \n      1) bases and top structures of railway tracks; (The specialist - the Civil engineer of means of communication, the Minimum material equipment on the property right - the crane, the machine, a shpalopodboynik, the dump truck, the excavator, the bulldozer, the grader, a level, a theodolite, a relsoukladchik (tracklayer), the welding machine) \n      2) bases and coverings, protective constructions and arrangement of highways I and II of technical category and also intracity trunk line roads of the high-speed and regulated movement, carriageway of the main streets of city value of the continuous and regulated movement; (The specialist - the Engineer of highways, the Minimum material equipment on the property right - the grader, the asphalt distributor, the asphalt spreader the dump truck, a mill, the water-jetting vehicle, a skating rink, the concrete placer)\n      3) bases and coverings, protective constructions and arrangement of highways III, IV and V of technical category and also carriageway of streets of the settlements which are not main; (The specialist - the Engineer of highways, the Minimum material equipment on the property right - the grader, the asphalt distributor, the asphalt spreader, the dump truck, a mill, the water-jetting vehicle, a skating rink)\n      4) bases and coverings of runways of airfields and helipads;  \n(The specialist - the Engineer of highways and airfields, the Minimum material equipment on the property right - the grader, the asphalt distributor, the asphalt spreader the dump truck, a mill, the water-jetting vehicle, a skating rink, the concrete placer)\"'),(286,15,2,351,'Step 1. Preliminary verification of documents (the personal meeting with the Ipravo team is obligatory)'),(287,15,2,352,'Step 2. Payment of the state fee'),(288,15,2,353,'Step 3. Submission of documents on obtaining the license (personal presence is not required)'),(289,15,2,354,'Step 3.1. Receipt of the original set of documents (personal presence is not required)*'),(290,15,2,355,'Step 4. Receipt of the original set of documents (personal presence is not required)*'),(291,32,2,7,'Installation of processing equipment, commissioning'),(292,11,1,96,'KZTLC47'),(293,11,2,96,'KZTLC47'),(294,12,1,96,'Строительно-монтажные работы III категория'),(295,12,2,96,'Installation and construction works the III category'),(296,13,1,96,'Строительно-монтажные работы III категория'),(297,13,2,96,'Installation and construction works the III category'),(298,14,1,96,'Для уточнения по стоимости услуг, просим связаться с отделом продаж\nОбязательное производственной базы на праве собственности (хозяйственного ведения или оперативного управления) и (или) аренды, оснащенной:\n1) административно-производственными зданиями или помещениями, необходимыми для выполнения заявленных видов работ, подвида лицензируемого вида деятельности. При этом административные, производственные и иные здания или помещения производственной базы могут быть совмещены, если это не противоречит требованиям системы охраны труда и техники безопасности при проведении работ, а также не нарушает условия труда административных, технических и производственных работников.\n2) рабочими местами, организованными в соответствии с условиями труда\nНаличие в штате не менее одного аттестованного инженерно-технического работника, имеющего соответствующий аттестат по профилю работ входящих в состав запрашиваемого подвида лицензируемого вида деятельности и работающего на постоянной основе у заявителя по одной из следующих специализаций:\n  Монтаж технологического оборудования, пусконаладочные работы, связанные с:\n      1) гидротехническими и мелиоративными сооружениями; (Специалист - гидротехник по гидротехническим сооружениям,  Минимальная материально - техническая оснащенность на праве собственности - кран, скрепер, сваебойная установка, опалубка, леса строительные, кран, бетононасос (бадья, туфелька), бетоносмеситель (бетономешалка), башенный кран (для I категории)\n      2) производством строительных материалов, изделий и конструкций; (Специалист - техник производство строительных материалов изделий и конструкций, Минимальная материально - техническая оснащенность на праве собственности - кран, бульдозер, манипулятор, самосвал)\n      3) объектами театрально-зрелищного, образовательного, спортивного назначения (Специалист - инженер-электромеханик, Минимальная материально - техническая оснащенность на праве собственности - сварочное оборудование, набор инструментов, сварочное оборудование, манипулятор, автовышка)\n      4) связью, противоаварийной защитой, системой контроля и сигнализации, блокировкой на транспорте, объектах электроэнергетики и водоснабжения, иных объектах жизнеобеспечения, а также приборами учета и контроля производственного назначения. (Специалист - связист, инженер КиП, Минимальная материально - техническая оснащенность на праве собственности -набор инструментов, сварочное оборудование, контрольно-измерительные приборы по связи, электрике)'),(299,14,2,96,'For refining at the cost of services, we ask to contact sales office\nObligatory production base on the property right (economic management or operational management) and (or) the lease equipped:\n1) the administrative process buildings or rooms necessary for accomplishment of the stated work types, subspecies of the licensed type of activity. At the same time office, process and other buildings or premises of production base can be combined if it does not contradict requirements of a system of labor protection and safe engineering at work and also does not violate a working condition of administrative, technical and production workers.\n2) the jobs organized in accordance with the terms work\nAvailability in the state not less than one the certified engineering employee having the corresponding certificate on a profile of the works which are a part of required subspecies of the licensed type of activity and working at a permanent basis at the applicant on one of the following specializations:\n  The installation of processing equipment, commissioning connected with:\n      1) hydraulic engineering and meliorative constructions; (The specialist - the hydrotechnician on hydraulic engineering constructions, the Minimum material equipment on the property right - the crane, the scraper, svayeboyny installation, a timbering, the woods construction, the crane, the concrete pump (a tub, a shoe), a betonosmesitel (concrete mixer), the tower crane (for the I category)\n      2) production of construction materials, products and designs; (The specialist - the technician production of construction materials of products and designs, the Minimum material equipment on the property right - the crane, the bulldozer, the manipulator, the dump truck)\n      3) subjects to theatrical and spectacular, educational, sports appointment (The specialist - the electrical and mechanical engineer, the Minimum material equipment on the property 